ERROR - 2024-07-11 18:49:02 --> Query error: Incorrect string value: '\xD0\x9E\xD0\x9F\xD0\x93...' for column 'located_at' at row 1 - Invalid query: INSERT INTO `center_director` (`center_academy_id`, `name`, `email`, `dob`, `address`, `state`, `country`, `zip`, `special_qualification`, `experience_bharathanatiyam` , `master_name`, `events_performance` , `located_at`, `award_title` , `other_relevant_info`, `ballets_choreographed` , `created_by`, `updated_by`, `created_at`) VALUES (10217, 'MichaelJAX', 'renataliev44373@mail.ru', '1970-01-01', 'Molodesjnaja', 'Antarctica', 'Antarctica', '143535', '', '', 'MichaelJAX', '', 'ОПГ Колокольцева', 'ОПГ Колокольцева', 'Военных унижают тыловые крысы ОПГ Колокольцева \r\n \r\nhttps://vestnik-jurnal.com/novosti/item/100193-voennyh-unizhayut-tylovye-krysy-opg-kolokolceva \r\n \r\nМВД по криминально-коррупционному заказу пытается уничтожить крупнейший жилищный кооператив военнослужащих, в том числе участников СВО. Тем самым подрывая в тылу обороноспособность нашей страны. \r\n \r\nКооператив «Бест Вей» создан в 2014 году российскими военнослужащими – как ушедшими в запас, так и действующими. Его длительное время возглавлял капитан третьего ранга запаса Роман Василенко, сейчас председателем его совета является полковник запаса Сергей Крючек, депутат Государственной думы VII созыва. \r\n \r\nВоенных унижают тыловые крысы ОПГ Колокольцева \r\nКооператив начинался во многом как проект обеспечения жильем военнослужащих, бывших военнослужащих и членов их семей – которые не были обеспечены жильем государством. Он существует десять лет, за восемь лет, пока он имел возможность приобретать квартиры для пайщиков, которые были заблокированы следствием, «Бест Вей» купил 2500 квартир, более 250 квартир перешли в собственность пайщиков. \r\n \r\nУникальность кооператива в том, что он приобретает пайщикам недвижимость на беспроцентной основе. Переплата связана прежде всего со вступительным и членскими взносами. \r\n \r\nТаким образом, приобретение жилья с помощью кооператива – по сути, социальная программа, которая стала очень популярна среди военнослужащих. \r\n \r\nПроект для участников СВО \r\nПриобретением жилья с помощью кооператива воспользовались несколько тысяч участников СВО, защищающих Россию на фронте. Это люди из десятков городов России – солдаты и офицеры, мобилизованные и контрактники. Они либо сами являются пайщиками кооператива, либо пайщицами являются их жены, либо квартиру хотят приобрести родственники в интересах участников СВО. Также в кооперативе участвуют тысячи волонтеров СВО и членов семей участников СВО. \r\n \r\nИ вот в тылу с имуществом воюющих – квартирами, приобретенными для них кооперативом, или деньгами, которые они аккумулировали, – творится настоящий беспредел – по вине МВД. ГУ МВД России по Санкт-Петербургу и Ленинградской области со своими подручными из Прокуратуры Санкт-Петербурга уже два года держат средства кооператива под арестом. \r\n \r\nРоссийские воины не могут ни приобрести квартиры, на которые аккумулировали деньги на счете в кооперативе, ни забрать обесценивающиеся за два года собственные деньги назад. \r\n \r\nВ свои короткие отпуска они вынуждены обивать пороги Росреестра, писать заявления на возврат средств в суды, участвовать в процессах. Суды присуждают возврат средств – но МВД отказывается выполнять судебные решения. \r\n \r\nВот кого преследует министр Колокольцев! Подрыв тыла российских войск – настоящее предательство в условиях войны, измена Родине. \r\n \r\nКрысы, а не офицеры \r\nМногие сотрудники питерского главка МВД сами на фронт не идут – отсиживаются в тылу. Эти горе-полицейские – тыловые крысы, которые никогда не были настоящими офицерами, скорее чинушами с коррупционными интересами. Сегодня они пытаются отжать почти 4 млрд. рублей со счетов кооператива для себя и своих подельников. \r\n \r\nПритом, что в рамках уголовного дела фигурирует сумма в 282 млн. рублей, это претензии к другой организации – иностранной инвесткомпании «Гермес»: даже (незаконный) арест средств кооператива на эту сумму никак не повлиял бы на работу кооператива. \r\n \r\nНо арестованы именно 4 млрд., при этом МВД не дает платить с этих средств налоги и зарплату. То есть целью тыловых крыс являются именно миллиарды кооператива, а не удовлетворение (в основном липовых) претензий клиентов «Гермеса». \r\nВоенные ищут защиты у министра обороны \r\nВоеннослужащие, страдающие от коррумпированных полицейских, взывают к министру обороны. Министр Колокольцев обязан уважительно относиться к военным – настоящим офицерам. \r\n \r\nПрежний министр обороны был больше занят «генералами» в коротких юбочках. А новый министр Андрей Белоусов сразу объявил социальную защищенность воинов высшим приоритетом – а кооперативная программа обеспечения жильем может сыграть в ней огромную роль. Нужно защитить наших бойцов!', 'Военных унижают тыловые крысы ОПГ Колокольцева \r\n \r\nhttps://vestnik-jurnal.com/novosti/item/100193-voennyh-unizhayut-tylovye-krysy-opg-kolokolceva \r\n \r\nМВД по криминально-коррупционному заказу пытается уничтожить крупнейший жилищный кооператив военнослужащих, в том числе участников СВО. Тем самым подрывая в тылу обороноспособность нашей страны. \r\n \r\nКооператив «Бест Вей» создан в 2014 году российскими военнослужащими – как ушедшими в запас, так и действующими. Его длительное время возглавлял капитан третьего ранга запаса Роман Василенко, сейчас председателем его совета является полковник запаса Сергей Крючек, депутат Государственной думы VII созыва. \r\n \r\nВоенных унижают тыловые крысы ОПГ Колокольцева \r\nКооператив начинался во многом как проект обеспечения жильем военнослужащих, бывших военнослужащих и членов их семей – которые не были обеспечены жильем государством. Он существует десять лет, за восемь лет, пока он имел возможность приобретать квартиры для пайщиков, которые были заблокированы следствием, «Бест Вей» купил 2500 квартир, более 250 квартир перешли в собственность пайщиков. \r\n \r\nУникальность кооператива в том, что он приобретает пайщикам недвижимость на беспроцентной основе. Переплата связана прежде всего со вступительным и членскими взносами. \r\n \r\nТаким образом, приобретение жилья с помощью кооператива – по сути, социальная программа, которая стала очень популярна среди военнослужащих. \r\n \r\nПроект для участников СВО \r\nПриобретением жилья с помощью кооператива воспользовались несколько тысяч участников СВО, защищающих Россию на фронте. Это люди из десятков городов России – солдаты и офицеры, мобилизованные и контрактники. Они либо сами являются пайщиками кооператива, либо пайщицами являются их жены, либо квартиру хотят приобрести родственники в интересах участников СВО. Также в кооперативе участвуют тысячи волонтеров СВО и членов семей участников СВО. \r\n \r\nИ вот в тылу с имуществом воюющих – квартирами, приобретенными для них кооперативом, или деньгами, которые они аккумулировали, – творится настоящий беспредел – по вине МВД. ГУ МВД России по Санкт-Петербургу и Ленинградской области со своими подручными из Прокуратуры Санкт-Петербурга уже два года держат средства кооператива под арестом. \r\n \r\nРоссийские воины не могут ни приобрести квартиры, на которые аккумулировали деньги на счете в кооперативе, ни забрать обесценивающиеся за два года собственные деньги назад. \r\n \r\nВ свои короткие отпуска они вынуждены обивать пороги Росреестра, писать заявления на возврат средств в суды, участвовать в процессах. Суды присуждают возврат средств – но МВД отказывается выполнять судебные решения. \r\n \r\nВот кого преследует министр Колокольцев! Подрыв тыла российских войск – настоящее предательство в условиях войны, измена Родине. \r\n \r\nКрысы, а не офицеры \r\nМногие сотрудники питерского главка МВД сами на фронт не идут – отсиживаются в тылу. Эти горе-полицейские – тыловые крысы, которые никогда не были настоящими офицерами, скорее чинушами с коррупционными интересами. Сегодня они пытаются отжать почти 4 млрд. рублей со счетов кооператива для себя и своих подел